(00000000001, 'サイトオープンにあたりまして', '<p>　　<br />\n　　　　＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊<br />\n　　　　　　　ようこそ！新しいサイトが出来ました！</p>\n\n<p>　　　　＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊</p>\n\n<p>　　かねてよりご要望いただいておりました</p>\n\n<p>　　　　　　『ビンハンニホン株式会社』　ＷＥＢサイト　</p>\n\n<p>　　　　　　　　　　　　　　　　　がリニューアルオープン致しました。</p>\n\n<p>　　皆さまと一緒にこのサイトを盛り上げていきたいと思っておりますので</p>\n\n<p>　　よろしくお願い致します。</p>\n\n<p>　　　　　　　　　　　　　　　　　　　　　　　　＊＊　スタッフ一同　＊＊</p>\n\n<p>', '2016-10-05', 1, 'A'),
