INSERT INTO `product` (`id`, `name`, `product_code`, `product_category`, `description`, `product_image`, `product_price`, `shipping_class`, `shipping_charge`, `measurement`, `upper_limit`, `date_add`, `date_modified`, `status`, `internal_capacity`, `common_id`) VALUES
(9, '炳翰人参粉', '01', 'main', '　中国の長白山系で栽培された6年根のオタネ人参を、ビンハン独自の低熱加工技術と微細粉末加工技術で粉末化しました。\r\n　粉末にしたことで、オタネ人参の栄養成分を丸ごと吸収できるようになりました。\r\n\r\n[価格]\r\n希望小売価格　：26,740円（税込）\r\n会　員　価　格　：24,473円（税込）\r\n\r\n名　 称　 ：オタネニンジン人参粉末加工食品\r\n原材料　 ：オタネ人参\r\n内容量　 ：150ｇ\r\n\r\n[お召し上がり方]\r\n1日2～5gを目安に水またはお湯に溶かしてお召し上がりください。シェイクしていただければ、より美味しくお飲みいただけます。\r\n\r\n[保存方法]\r\nお子様の手の届かない場所に保管してください。開封後はふたをしっかり閉め、湿気の少ない涼しい場所に保管してください。\r\n\r\n[注意事項]\r\nご愛用中に異常を感じた場合は、一旦使用を中止するか量を減らして専門医にご相談ください。\r\n保存料は使用しておりませんので、なるべく早くお召し上がりください。\r\n一度に大量にお召し上がりにならずに、初めは少しずつからお召し上がりください。\r\n食生活は、主食、主菜、副菜を基本に、バランスが大切です。\r\n\r\n[栄養成分]\r\n熱量19.35Kcal　たんぱく質0.8g　脂質0.25mg　炭水化物3.47g(5ｇ当たり)ナトリウム1.2mg\r\nカリウム78.5mg　カルシウム15.6mg　ビタミンA 1IUβ―カロテン0.5IU　亜鉛0.13mg　鉄0.89mg\r\n銅0.05mg　マンガン0.2mg　マグネシウム7.35mg\r\n\r\n[特徴成分]\r\nGinsenoside Rb1 57.1mg 　Ginsenoside Rg2 34.85mg　Ginsenoside Re 29mg\r\nGinsenoside Rg1 16.65mg　Ginsenoside Rd   24.9mg 　Ginsenoside Rc 23.55mg\r\nGinsenoside Rb2 6.3mg　Ginsenoside Rh1 5.2mg', '1475648254_Product-01.png', 24473.0000, 'common', 0.0000, '本', 33, '2016-01-21', '2016-01-21', 'A', '1本', 0),
(10, '人参花茶 1セット', '03', 'main', '　オタネ人参のつぼみを低熱処理し、爽やかな風味のお茶に仕上げました。オタネ人参花の栄養分がたっぷり含まれていますので、特にビジネスマンや受験生等の栄養補給にお勧めです。\r\n\r\n[価格]\r\n１セット（1セット10個入）\r\n希望小売価格　：26,740円（税込）\r\n会　員　価　格　：24,473円（税込）\r\n\r\n名　 称　 ：オタネ人参花茶ティーバッグ\r\n原材料　 ：オタネニンジンの花\r\n内容量　 ：15g（1.5g×10包）×10個\r\n\r\n[お召し上がり方]\r\n容器に１つのティーバッグを入れ、300～500ccのお湯を注ぎ3分～5分放置して、味がよく出た後にお召し上がりください。\r\n\r\n[保存方法]\r\nお子様の手の届かない場所に保管してください。開封後はふたをしっかり閉め、湿気の少ない涼しい場所に保管してください。\r\n\r\n[注意事項]\r\nご愛用中に異常を感じた場合は、一旦使用を中止するか量を減らして専門医にご相談ください。\r\n保存料は使用しておりませんので、なるべく早くお召し上がりください。\r\n一度に大量にお召し上がりにならずに、初めは少しずつからお召し上がりください。\r\n食生活は、主食、主菜、副菜を基本に、バランスが大切です。\r\n\r\n[栄養成分]\r\n熱量 5Kcal　たんぱく質 0.3g　脂質0.1mg　炭水化物 1.1g(1.5ｇ当たり)　ナトリウム 0.4mg\r\n鉄 0.3mg　カリウム 23.4mg 　カルシウム 4.8mg', '1475648223_Product-03.png', 24473.0000, '', 764.0000, 'ｾｯﾄ', 50, '2016-01-21', '2016-01-21', 'A', '1ｾｯﾄ　10箱入', 0),
(11, '参楽', '02', 'main', '　粉末状にしたオタネ人参に、エキスを加えた無添加・無着色の栄養補助食品です。どなたにも飲みやすいカプセルタイプにしました。\r\n　持ち運びも便利で、職場や旅行先でもお気軽にお召し上がりいただけます。\r\n\r\n[価格]\r\n希望小売価格　：26,740円（税込）\r\n会　員　価　格　：24,473円（税込）\r\n\r\n名　 称　 ：オタネニンジンカプセル加工食品\r\n原材料　 ：オタネ人参粉末、オタネニンジンエキス,（ヒトロキシプロピルメチルセルロースHPMC）\r\n内容量　 ：100粒\r\n\r\n[お召し上がり方 ]\r\n1日2～4カプセルを目安に、水またはぬるま湯等と一緒にお召し上がりください。\r\n\r\n[保存方法]\r\nお子様の手の届かない場所に保管してください。開封後はふたをしっかり閉め、湿気の少ない涼しい場所に保管してください。\r\n\r\n[注意事項]\r\nご愛用中に異常を感じた場合は、一旦使用を中止するか量を減らして専門医にご相談ください。\r\n保存料は使用しておりませんので、なるべく早くお召し上がりください。\r\n一度に大量にお召し上がりにならずに、初めは少しずつからお召し上がりください。\r\n食生活は、主食、主菜、副菜を基本に、バランスが大切です。\r\n\r\n[栄養成分]\r\n熱量 5Kcal　たんぱく質 0g　脂質 0mg　炭水化物 1g　　ナトリウム 0mg', '1475648265_Product-02.png', 24473.0000, 'common', 2000.0000, '本', 33, '2016-01-21', '2016-01-21', 'A', '1本', 0),
(14, '商品チラシ', '07', 'sub', 'テスト', '1455340708_1455167412_no-image-box.png', 306.0000, 'individgual', 0.0000, 'ｾｯﾄ', 100, '2016-02-06', '2016-02-06', 'A', '1ｾｯﾄ 10枚入', 0),
(15, 'シェーカー1ケース', '05', 'main', 'シェーカー　1ケース\r\n\r\n[価格]\r\n１ケース（96本入）\r\n希望小売価格　：48,380円（税込）\r\n会　員　価　格　：47,500円（税込）', '1565325203_シェーカー画像.JPG', 48380.0000, 'individgual', 866.0000, 'ｹｰｽ', 100, '2016-02-07', '2016-02-07', 'A', '1ｹｰｽ　96本入り', 0),
(16, '商品チラシ（新版）', '06', 'main', '商品チラシ（新版）\r\n\r\n[会員価格]\r\n1セット（10枚入り）：500円（税込）', '1475648202_Product-04.png', 510.0000, 'individgual', 0.0000, 'セット', 100, '2016-02-07', '2016-02-07', 'A', '1セット　10枚入', 0),
(17, 'シェーカー 1本', '04', 'main', '　漏れにくさを追求した炳翰人参粉用のシェーカーです。人参の溶けやすさと持ちやすさの両方に配慮した形状になっています。\r\n\r\n[会員価格]\r\n1本 ： 515円（税込）\r\n\r\n[推奨使用量]\r\n400cc \r\n\r\n[耐 熱 温 度]\r\n‐20～100℃', '1475648159_Product-04.png', 525.0000, 'common', 0.0000, '本', 95, '2016-02-07', '2016-02-07', 'A', '1本', 0),
